import React from "react";
import { Container, Card, CardHeader, Col, Row, FormGroup } from "shards-react";
import formItems from "../../data/form-items";

export default function FormCatalogue() {
  return (
    <Container fluid>
      <Row>
        <Col>
          <Card >
            <CardHeader>
              <h4>Question Banks</h4>
            </CardHeader>
          </Card>

          <Col
            style={{ maxHeight: "70vh", overflowY: "auto", overflowX: "none" }}
          >
            {formItems.map((item, i) => {
              const { component: Component } = item;
              return (
                <Component
                  title={item.title}
                  type={item.type}
                  options={item.options}
                />
              );
            })}
          </Col>
        </Col>

        <Col className="bg-white" style={{height: "70vh"}}></Col>
      </Row>
    </Container>
  );
}
